import React from "react";
import { Link } from "react-router-dom";

function Nav(){
    return(
        // <nav class="my-navbar site-header sticky-top py-1">
        // <div class="container d-flex flex-column flex-md-row justify-content-between">
        //     <p class="py-2">
        //     <Link to="/home" >
        //     <img src="./logo.png" style={{height:'30px'}}></img>
        //     </Link>
        //     </p>
        //     <p class="py-2 d-none d-md-inline-block">
        //         <Link to="/academics" style={{textDecoration:'none'}}>Academics</Link>
        //     </p>
        //     <p class="py-2 d-none d-md-inline-block">
        //     <Link to="/clubs" style={{textDecoration:'none', padding: '5px'}} >Clubs and Chapters</Link>
        //     </p>
        //     <p class="py-2 d-none d-md-inline-block">
        //         <Link to="/clubs" style={{textDecoration:'none', padding: '5px'}} >Connect</Link>
        //     </p>

        // </div>
        // </nav>

        <nav class="navbar navbar-expand-lg bg-dark border-bottom border-bottom-dark" data-bs-theme="dark">
        <div class="container-fluid">
            <a class="navbar-brand" href="#"><Link to="/home" >
                    <img src="./logo.png" style={{height:'30px'}}></img>
                </Link></a>
            <button class="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNavDropdown" aria-controls="navbarNavDropdown" aria-expanded="false" aria-label="Toggle navigation">
            <span class="navbar-toggler-icon"></span>
            </button>
            <div class="collapse navbar-collapse" id="navbarNavDropdown">
            <ul class="navbar-nav">
                <li class="nav-item">
                <a class="nav-link active" aria-current="page">

                </a>
                </li>
                <li class="nav-item">
                <a class="nav-link" href="#">Features</a>
                </li>
                <li class="nav-item">
                <a class="nav-link" href="#">Pricing</a>
                </li>
                <li class="nav-item dropdown">
                <a class="nav-link dropdown-toggle" href="#" role="button" data-bs-toggle="dropdown" aria-expanded="false">
                    Dropdown link
                </a>
                <ul class="dropdown-menu">
                    <li><a class="dropdown-item" href="#">Action</a></li>
                    <li><a class="dropdown-item" href="#">Another action</a></li>
                    <li><a class="dropdown-item" href="#">Something else here</a></li>
                </ul>
                </li>
            </ul>
            </div>
        </div>
        </nav>
    )
}

export default Nav;
